// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "./Committable.sol";

contract CommittableRegistry is Ownable, AccessControlEnumerable {
    /**
    * @dev
    */
    event DeployCommittable(
        string indexed repoURI,
        string indexed repoName,
        string indexed repoSymbol,
        Committable newCommittable
    );

    /**
    * @dev
    */
    event MintCommittable(
        address indexed minter,
        string indexed repoURI,
        string indexed tokenURI,
        uint256 tokenId
    );

    // Mapping from repo URL to activate status and repo owner
    mapping(string => bool) public activates;
    mapping(string => mapping(address => bool)) public owners;

    // Mapping from repo URL to deployed committable contract
    mapping(string => Committable) public committables;

    // Array with all deployed repo URLs, used for enumeration
    string[] public repos;

    /**
    * @dev
    */
    constructor() {
        // Grant `CommittableRegistry` owner as "COMMITTABLE_ADMIN" role, which controls whether
        // addresses can be regarded as "REPO_OWNER" (i.e., repository owner).
        _setupRole(keccak256("COMMITTABLE_ADMIN"), _msgSender());
        _setRoleAdmin(keccak256("REPO_OWNER"), keccak256("COMMITTABLE_ADMIN"));
    }

    /**
    * @dev Retrieve number of git repositories that are already activated by their owners.
    */
    function numberOfRepos() public view returns (uint256) {
        return repos.length;
    }

    /**
    * @dev
    */
    modifier canActivate() {
        require(owner() == _msgSender()
            || hasRole(keccak256("REPO_OWNER"), _msgSender()),
            "CommittableRegistry: caller is not owner of either registry or repo");
        _;
    }

    /**
    * @dev Deploy a new committable contract, which represents a new activated git repository.
    *
    * This function is invoked when repository owner chooses to activate `Committable` for his/her repository.
    */
    function activateCommittable(
        string memory repoURI,
        string memory repoName,
        string memory repoSymbol
    ) public canActivate virtual returns (Committable) {
        require(!activates[repoURI], "The repository has already deployed as Committable!");

        Committable committable = new Committable(repoName, repoSymbol);
        activates[repoURI] = true;
        committables[repoURI] = committable;
        repos.push(repoURI);

        emit DeployCommittable(repoURI, repoName, repoSymbol, committable);
        return committable;
    }

    /**
    * @dev
    */
    modifier canMint() {
        require(owner() == _msgSender()
            || hasRole(keccak256("REPO_CONTRIBUTOR"), _msgSender()),
            "CommittableRegistry: caller is not registry contributor or registry owner");
        _;
    }

    /**
    * @dev
    */
    function mintCommittable(
        string memory repoURI,
        uint256 commitId,
        string memory tokenURI,
        address committer
    ) public canMint virtual returns (uint256) {
        require(activates[repoURI], "The repository has not been deployed as Committable!");

        Committable committable = committables[repoURI];
        uint256 tokenId = committable.mint(committer, commitId, tokenURI);
        emit MintCommittable(committer, repoURI, tokenURI, tokenId);
        return tokenId;
    }

    /**
    * @dev
    */
    modifier canGrant() {
        require(owner() == _msgSender()
            || hasRole(keccak256("REPO_OWNER"), _msgSender()),
            "CommittableRegistry: caller is not owner of either registry or repo");
        _;
    }

    /**
    * @dev
    */
    function grantDividend(string memory repoURI, uint256 amount) public canGrant virtual {
        require(activates[repoURI], "The repository has not been deployed as Committable!");

        Committable committable = committables[repoURI];
        committable.grantDividend(amount);
    }
}
